import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import BuscarLibro from './components/BuscarLibro';
import MisLibros from './components/MisLibros';
import RegistrarLibro from './components/RegistrarLibro';
import GuardarLectura from './components/GuardarLectura';
import './App.css';

function App() {
  return (
    <Router>
      <div>
        <h1>ðŸ“š 6262</h1>
        <nav>
          <Link to="/">Buscar</Link> | <Link to="/mis-libros">Mis Libros</Link>
        </nav>
        <hr />
        <Routes>
          <Route path="/" element={<BuscarLibro />} />
          <Route path="/mis-libros" element={<MisLibros />} />
          <Route path="/registrar-libro/:id" element={<RegistrarLibro />} />
          <Route path="/guardar-libro" element={<GuardarLectura />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
